import { react } from "react";
import "../App.css";
import HomeApi from "./HomeApi";
import SellerForm from "./SellerForm"
import Item from "./Item";
import WatchApi from "./WatchApi";
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <Router>
      <Switch>
          <Route path="/sellerForm">
          <SellerForm/>
          </Route>
          <Route path="/" exact>
          <HomeApi/>
        </Route>
        <Route path="/item/:id">
          <Item/>
        </Route>
        <Route path="/watchList">
          <WatchApi/>
      </Route>
        </Switch>
      </Router>
  );
}

export default App;
